The concept here is very simple. We use 2 selectors for a callback function and accessing a server, and recv_timeout() to receive a response from the server. We only show Rust code of a publisher as follows. Other files can be found in Source code . use safe_drive::{ context::Context, error::DynError, logger::Logger, msg::common_interfaces::{std_msgs, std_srvs}, pr_fatal, pr_info, selector::Selector, service::client::Client, topic::subscriber::Subscriber, RecvResult,
};
use std::time::Duration; fn main() -> Result<(), DynError> { // Create a context and a node. let ctx = Context::new()?; let node = ctx.create_node("listen_client", None, Default::default())?; // Create 2 selectors. let selector = ctx.create_selector()?; let selector_client = ctx.create_selector()?; // Create a subscriber, a client, and a logger. let subscriber = node.create_subscriber::<std_msgs::msg::Empty>("pubsubsrv_topic", None)?; let client = node.create_client::<std_srvs::srv::Empty>("pubsubsrv_service", None)?; worker(selector, selector_client, subscriber, client)?; Ok(())
} fn worker( mut selector: Selector, mut selector_client: Selector, subscriber: Subscriber<std_msgs::msg::Empty>, client: Client<std_srvs::srv::Empty>,
) -> Result<(), DynError> { let mut client = Some(client); let logger = Logger::new("listen_client"); selector.add_subscriber( subscriber, Box::new(move |_msg| { pr_info!(logger, "receive a message"); // Take the client. let c = client.take().unwrap(); let request = std_srvs::srv::EmptyRequest::new().unwrap(); // Send a request. let receiver = c.send(&request).unwrap(); // Receive a response. match receiver.recv_timeout(Duration::from_millis(20), &mut selector_client) { RecvResult::Ok((c, _response, _header)) => { pr_info!(logger, "receive a response"); client = Some(c) } RecvResult::RetryLater(r) => client = Some(r.give_up()), RecvResult::Err(e) => { pr_fatal!(logger, "{e}"); panic!() } } }), ); loop { selector.wait()?; }
}

