A service's state can be represented as follows. graph LR; Start--&gt;Send Send--&gt;Receive Receive--&gt;Send To represent the state, safe_drive uses the type system of Rust. First, a client is created as follows. At that time, it must be Send state. let mut client = Some(client); // Send state. send() method consumes the client and returns receiver. It means the state is changed from Send to Receive. let c = client.take().unwrap();
let receiver = c.send(&request).unwrap(); // Change state from Send to Receive. recv_timeout() also consumes receiver and returns a new client to send a new request if it successfully receives a response. // Receive a response.
match receiver.recv_timeout(Duration::from_millis(20), &mut selector_client) { RecvResult::Ok((c, _response, _header)) => { pr_info!(logger, "receive a response"); client = Some(c) } RecvResult::RetryLater(r) => client = Some(r.give_up()), RecvResult::Err(e) => { pr_fatal!(logger, "{e}"); panic!() }
} When it has timed out, you can choose retrying or giving up. This code chooses giving up by give_up() method. give_up() methods consumes a receiver and return a new client to send a new request. This code will work, but we think using async/await is better than this because it is designed for asynchronous programming. I recommend to rewrite this code by using async/await.
